window.bookSummaryJSON = "<p>What lies on the dark side of the moon could change the course of humanity forever. </p> <p>When a Chinese rover discovers an alien technology on the dark side of the moon, it is up to Richard \"Rock\" Crandon and his NASA team of scientists and engineers to devise a way to return before the Chinese and Russians. </p> <p>Forced to deal with bureaucratic oversight and a complex team of personalities, Rock Crandon pushes his team to their limits. </p> <p>With pressure mounting, the world is pushed closer to conflict and war as the NASA team finds itself seriously behind in the newly initiated space race. The future of mankind, its ideological and technological advances are at stake, as the world's super powers race to discover what lies on the dark side of the moon. </p> <p>Who will get there first, and at what cost? </p>"; 
